    self.__lock.acquire()
    ticket = ParkingTicket()
    vehicle.assign_ticket(ticket)
    ticket.save_in_DB()
    # if the ticket is successfully saved in the database, we can increment the parking spot count
    self.__increment_spot_count(vehicle.get_type())
